import{_ as t,o as p,c as i,d as e}from"./app-8f633995.js";const o="/assets/1694614828681-0417c930.png",s="/assets/1694614859619-508028f2.png",c="/assets/1694614875540-b1cf6139.png",r={},u=e('<p>(注:抄自CSDN:https://blog.csdn.net/qq_35246620/article/details/66980283)</p><p>1 前言</p><p>GitHub 是一个面向开源及私有软件项目的托管平台，因为只支持 Git 作为唯一的版本库格式进行托管，故名 GitHub。</p><p>GitHub 于 2008 年 4 月 10 日正式上线，除了 Git 代码仓库托管及基本的 Web 管理界面以外，还提供了订阅、讨论组、文本渲染、在线文件编辑器、协作图谱（报表）、代码片段分享（Gist）等功能。目前，其托管版本数量非常之多，而且其中不乏知名开源项目，例如 Ruby on Rails、jQuery、python 等。</p><p>作为开源代码库以及版本控制系统，Github 拥有超过千万的开发者用户。随着越来越多的应用程序转移到了云上，Github 已经成为了管理软件开发以及发现已有代码的首选方法。</p><p>如前所述，作为一个分布式的版本控制系统，在 Git 中并不存在主库这样的概念，每一份复制出的库都可以独立使用，任何两个库之间的不一致之处都可以进行合并。</p><p>GitHub 可以托管各种 Git 库，并提供一个 web 界面，但与其它像 SourceForge 或 Google Code 这样的服务不同，GitHub 的独特卖点在于从另外一个项目进行分支的简易性。为一个项目贡献代码非常简单：首先点击项目站点的Fork的按钮，然后将代码检出并将修改加入到刚才分出的代码库中，最后通过内建的pull request机制向项目负责人申请代码合并。</p><p>GitHub 项目本身自然而然的也在 GitHub 上进行托管，只不过在一个私有的，公共视图不可见的库中。开源项目可以免费托管，但私有库则并非如此。在 GitHub，用户可以通过Explore轻而易举地找到海量的开源代码。因此，称之为程序员的 圣地 也不过吧？ 2 业界大神</p><p>在 GitHub 上建立个人主页的业界大神多如牛毛，在此仅介绍 3 位，以供大家膜拜！ 2.1 Linus Torvalds</p><p><img src="'+o+`" alt="1694614828681"></p><pre><code>GitHub 主页：https://github.com/torvalds
</code></pre><p>Linus Torvalds，全球著名的电脑程序员、黑客，Linux 之父。 2.2 John Resig</p><p>John</p><pre><code>Github主页： https://github.com/jeresig
</code></pre><p>John Resig，jQuery 的创始人和技术领袖，著有《Pro JavaScript Techniques》（即《精通JavaScript》）等经典 JavaScript 书籍。 2.3 Jake Wharton</p><p>Jake Wharton</p><p><img src="`+s+`" alt="1694614859619"></p><pre><code>Github主页： https://github.com/JakeWharton
</code></pre><p>Jake Wharton， Android 之神，GitHub 全球排名第二位。</p><p><img src="`+c+`" alt="1694614875540"> 3 开源项目及公司</p><p>在 GitHub 上开源的著名项目非常之多，选择在 GitHub 上开源的世界顶级公司也很多，在此也各罗列 3 个，以供大家膜拜！ 3.1 项目</p><pre><code>Linux：https://github.com/torvalds/linux
Swift：https://github.com/apple/swift
Ruby：https://github.com/ruby/ruby
</code></pre><p>3.2 公司</p><pre><code>Google: https://github.com/google
Microsoft：https://github.com/microsoft
Alibaba：https://github.com/alibaba
</code></pre><p>3.3 我的项目</p><pre><code>名称：Sylph 希尔芙，风之精灵
地址：https://github.com/guobinhit/sylph
功能：Go 语言实现的工具包，提供了常用的字符串、切片、日期和指针等实用方法。
</code></pre><p>4 篇尾语</p><p>通过上面的介绍，相信大家已经对 GitHub 有了初步的了解啦！窥一斑而知全豹，GitHub 的魅力可想而知。作为程序员大军中的一员，你是想泯然于众人？还是想与大神们“零距离”接触、碰撞出思维的火花？GitHub，也许就是你人生中至关重要的转折点。</p><p>咳咳，好吧，我承认，上面说的太玄乎了，现在说点实在的。在中国（全球更是如此），顶级的互联网公司，如 BAT，都很看重 GitHub ，如果你能够在 GitHub 上面表现的非常活跃，或者自己开源几个项目（并不要求这些项目多么伟大），甚至对一些著名的开源项目贡献了自己的代码，相信这一切，都会为你加分不少，从而脱颖而出。此外，GitHub 也是一个很好的学习场所，那么多的优秀开源项目，任君学习。无论是从求职还是个人发展来说，选择 GitHub 并不会错。 ———————————————— 版权声明：本文为CSDN博主「CG国斌」的原创文章，遵循CC 4.0 BY-SA版权协议，转载请附上原文出处链接及本声明。 原文链接：https://blog.csdn.net/qq_35246620/article/details/66980283</p>`,29),n=[u];function b(a,h){return p(),i("div",null,n)}const G=t(r,[["render",b],["__file","202396161932.html.vue"]]);export{G as default};
